import FeatureRooms from "../components/FeatureRooms";
import Button from '../components/StyledHero'

const Home = () => {
    return (
        <>
        <Hero>
            <Banner title="Luxurious Rooms" subtitle="Delux rooms starting at $399">
                <Link to="/rooms" className="btn-primary">
                    Our Rooms
                </Link>
            </Banner>
        </Hero>
        <Services />
        <FeatureRooms />
            <Button>hello</Button>
        </>
    )
}

export default Home
